import React from 'react';
import './JoueurStar.css';

import Giannis from '../images/Giannis.png';

import {Row} from 'react-bootstrap';


export default class JoueurStar extends React.Component {
    
    render() {
        return(           
            <Row className="sort">
                
                <div>{this.props.nom}</div>
            </Row>
        );
    }
}
